CREATE TABLE Suppliers (
	SupplierID INT IDENTITY(1, 1)
	,SupplierName NVARCHAR(100) NOT NULL
	,StreetAddress NVARCHAR(255) NOT NULL
	,City NVARCHAR(100) NOT NULL
	,PostalCode NVARCHAR(20) NOT NULL
	,Country NVARCHAR(100) NOT NULL
	,ContactPerson NVARCHAR(100) NOT NULL
	,ContactEmail NVARCHAR(100) NOT NULL
	,ContactPhone NVARCHAR(30) NOT NULL
	,Rating INT NOT NULL
	,PreferredShippingMethod NVARCHAR(100) NOT NULL
	,CONSTRAINT PK_Suppliers PRIMARY KEY (SupplierID)
	,CONSTRAINT UK_SupplierName UNIQUE (SupplierName)
	,CONSTRAINT UK_StreetAddress UNIQUE (StreetAddress)
	,CONSTRAINT CK_ValidPostalCodeFormat CHECK (PostalCode NOT LIKE '%[^A-Za-z0-9 -]%')
	,CONSTRAINT CK_ContainsSpaceInContactPerson CHECK (CHARINDEX(' ', ContactPerson) > 0)
	,CONSTRAINT CK_ValidEmailFormat CHECK (ContactEmail LIKE '%@%.%')
	,CONSTRAINT CK_ValidPhoneFormat CHECK (
		LEN(ContactPhone) >= 13
		AND NOT ContactPhone LIKE '%[a-zA-Z]%'
		AND CHARINDEX('(+', ContactPhone) = 1
		AND CHARINDEX(')', ContactPhone) <= 6
		AND CHARINDEX(' ', ContactPhone) <= 7
		AND CHARINDEX('-', ContactPhone) <= 11
		)
	,CONSTRAINT CK_RatingRange CHECK (
		Rating >= 1
		AND Rating <= 5
		)
	,CONSTRAINT CK_ValidShippingMethod CHECK (
		PreferredShippingMethod IN (
			'Ground Shipping'
			,'Air Shipping'
			,'Courier Services'
			,'Freight Shipping'
			,'Express Shipping'
			,'Postal Services'
			,'Intermodal Transportation'
			)
		)
	)
GO

