CREATE TABLE Parts (
	PartID INT IDENTITY(1, 1) PRIMARY KEY
	,PartName NVARCHAR(100) NOT NULL
	,PartDescription NVARCHAR(255)
	,PartQuantity INT NOT NULL
	,SupplierID INT NOT NULL
	,UnitCost DECIMAL(10, 2) NOT NULL
	,LastRestockDate DATE
	,CONSTRAINT FK_Suppliers FOREIGN KEY (SupplierID) REFERENCES Suppliers(SupplierID)
	,CONSTRAINT CK_PartQuantity CHECK (PartQuantity >= 0)
	,CONSTRAINT CK_UnitCost CHECK (UnitCost >= 0.00)
	,CONSTRAINT CK_LastRestockDate CHECK (LastRestockDate <= GETDATE())
	)
GO

