CREATE TABLE Warehouses (
	WarehouseID INT IDENTITY(1, 1)
	,WarehouseCity NVARCHAR(100) NOT NULL
	,WarehouseCountry NVARCHAR(100) NOT NULL
	,WarehouseCapacity INT NOT NULL
	,WarehouseManager NVARCHAR(100) NOT NULL
	,WarehousePhone NVARCHAR(30) NOT NULL
	,CONSTRAINT PK_Warehouses PRIMARY KEY (WarehouseID)
	,CONSTRAINT UK_WarehouseLocation UNIQUE (
		WarehouseCity
		,WarehouseCountry
		)
	,CONSTRAINT CK_ContainsSpaceInWarehouseManager CHECK (CHARINDEX(' ', WarehouseManager) > 0)
	,CONSTRAINT CK_ValidWarehousePhoneFormat CHECK (
		LEN(WarehousePhone) >= 13
		AND NOT WarehousePhone LIKE '%[a-zA-Z]%'
		AND CHARINDEX('(+', WarehousePhone) = 1
		AND CHARINDEX(')', WarehousePhone) <= 6
		AND CHARINDEX(' ', WarehousePhone) <= 7
		AND CHARINDEX('-', WarehousePhone) <= 11
		)
	)
GO

