CREATE TABLE Inventory (
	InventoryID INT IDENTITY(1, 1)
	,PartID INT NOT NULL
	,WarehouseID INT NOT NULL
	,QuantityAvailable INT NOT NULL
	,LastStockUpdate DATETIME NOT NULL DEFAULT GETDATE()
	,MinStockThreshold INT NOT NULL
	,MaxStockThreshold INT NOT NULL
	,CONSTRAINT PK_Inventory PRIMARY KEY (InventoryID)
	,CONSTRAINT FK_Parts FOREIGN KEY (PartID) REFERENCES Parts(PartID)
	,CONSTRAINT FK_Warehouses FOREIGN KEY (WarehouseID) REFERENCES Warehouses(WarehouseID)
	,CONSTRAINT CK_1 CHECK (PartID <= 62)
	,CONSTRAINT CK_3 CHECK (PartID > 0)
	,CONSTRAINT CK_2 CHECK (WarehouseID <= 28)
	,CONSTRAINT CK_4 CHECK (WarehouseID > 0)
	,CONSTRAINT CK_QuantityAvailable CHECK (QuantityAvailable >= 0)
	,CONSTRAINT CK_LastStockUpdateInReality CHECK (LastStockUpdate <= GETDATE())
	,CONSTRAINT CK_PositiveMinStockThreshold CHECK (MinStockThreshold >= 0)
	,CONSTRAINT CK_MaxIsBiggestThreshold CHECK (MaxStockThreshold > MinStockThreshold)
	)
GO

