CREATE TABLE Orders (
	OrderID INT IDENTITY(1, 1)
	,PartID INT NOT NULL
	,QuantityOrdered INT NOT NULL
	,OrderDate DATE NOT NULL
	,DeliveryDate DATE
	,OrderStatus NVARCHAR(50) NOT NULL
	,ShippingMethod NVARCHAR(50) NOT NULL
	,TrackingNumber NVARCHAR(40) NOT NULL
	,StreetAddress NVARCHAR(255) NOT NULL
	,FloorNumber INT
	,ApartmentNumber NVARCHAR(4)
	,City NVARCHAR(100) NOT NULL
	,PostalCode NVARCHAR(20) NOT NULL
	,Country NVARCHAR(100) NOT NULL
	,CONSTRAINT PK_Orders PRIMARY KEY (OrderID)
	,CONSTRAINT FK_PartsForOrders FOREIGN KEY (PartID) REFERENCES Parts(PartID)
	,CONSTRAINT CK_ValidQuantityOrderedRange CHECK (
		QuantityOrdered > 0
		AND QuantityOrdered <= 1000
		)
	,CONSTRAINT CK_DeliveryDateISAfterOrderDate CHECK (
		DeliveryDate IS NULL
		OR DeliveryDate > OrderDate
		)
	,CONSTRAINT CK_ValidOrderStatus CHECK (
		OrderStatus IN (
			'Pending'
			,'Processing'
			,'In Transit'
			,'Out for Delivery'
			,'Delivered'
			,'Cancelled'
			)
		)
	,CONSTRAINT CK_ValidOrderStatusSequence CHECK (
		(
			OrderStatus = 'Pending'
			AND DeliveryDate IS NULL
			)
		OR (
			OrderStatus = 'Processing'
			AND DeliveryDate IS NULL
			)
		OR (
			OrderStatus = 'In Transit'
			AND DeliveryDate IS NOT NULL
			)
		OR (
			OrderStatus = 'Out for Delivery'
			AND DeliveryDate IS NOT NULL
			)
		OR (
			OrderStatus = 'Delivered'
			AND DeliveryDate IS NOT NULL
			)
		OR (
			OrderStatus = 'Cancelled'
			AND DeliveryDate IS NULL
			)
		)
	,CONSTRAINT CK_ValidOrderShippingMethod CHECK (
		ShippingMethod IN (
			'Ground Shipping'
			,'Air Shipping'
			,'Courier Services'
			,'Freight Shipping'
			,'Express Shipping'
			,'Postal Services'
			,'Intermodal Transportation'
			)
		)
	,CONSTRAINT UK_TrackingNumber UNIQUE (TrackingNumber)
	,CONSTRAINT CK_ValidTrackingNumberFormat CHECK (TrackingNumber LIKE 'TN-%')
	,CONSTRAINT CK_ValidPostalCodeFormatForOrders CHECK (PostalCode NOT LIKE '%[^A-Za-z0-9 -]%')
	,CONSTRAINT CK_ValidAddressFormat CHECK (
		StreetAddress NOT LIKE '%[^A-Za-z0-9 -]%'
		AND City NOT LIKE '%[^A-Za-z ]%'
		AND Country NOT LIKE '%[^A-Za-z ]%'
		)
	,CONSTRAINT CK_ValidPostalCodeLength CHECK (LEN(PostalCode) <= 10)
	,CONSTRAINT CK_YouEnteredOneThenYouBetterEnterBoth CHECK (
		(
			FloorNumber IS NULL
			AND ApartmentNumber IS NULL
			)
		OR (
			FloorNumber IS NOT NULL
			AND ApartmentNumber IS NOT NULL
			)
		)
	)
GO

